sys_variable_value.value:
(function execute(inputs, outputs) {

    if (inputs.status_code == "204") {
        outputs.status = "Success";
    } else {
        outputs.message = new GoogleDirErrorHandler()
            .genericErrorHandler(inputs.status_code, inputs.response_body);
        outputs.status = "Error";
    }

})(inputs, outputs);

