sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new GoogleDirectoryUtils();
    inputs = utils.trimStringInputs(inputs);
    if (utils.isEmpty(inputs.user_key))
        throw new Error("User key cannot be empty");

    outputs.user_key = inputs.user_key;
})(inputs, outputs);

